// index.js

import React from "react";
import ReactDOM from "react-dom";
import { Provider } from "react-redux";
import { createStore, applyMiddleware } from "redux"; // Updated import statement
import thunk from "redux-thunk"; // Import Redux Thunk
import "./index.css";
import App from "./App";
import todoReducer from "./reducers";

const store = createStore(todoReducer, applyMiddleware(thunk)); // Apply Redux Thunk middleware

ReactDOM.render(
  <Provider store={store}>
    <React.StrictMode>
      <App />
    </React.StrictMode>
  </Provider>,
  document.getElementById("root")
);
